import React from "react"

class Izvestaji extends React.Component{
    constructor(){
        super()
        this.state = {
            izvestaji:[],
            pocetak:"",
            kraj:""
        }
        this.handleChange=this.handleChange.bind(this)
        this.handleClick=this.handleClick.bind(this)
    }

    handleClick(){
        console.log(this.state)
    }

    handleChange(event){
        const {name,value} = event.target
        this.setState({
            [name]:value
        })
    }

    render(){
        return(
            <div id="izvestaji">
                Pocetak izvestaja:<input onChange={this.handleChange} type="datetime-local" name="pocetak"/> <br/>
                Kraj izvestaja:<input onChange={this.handleChange} type="datetime-local" name="kraj"/> <br/>
                <button onClick={this.handleClick}>Kreiraj izvestaj</button>
            </div>
        )
    }
}

export default Izvestaji
